import React from 'react';
import { Link } from 'react-router-dom';
import one from './one.JPG';
import two from './two.JPG';
import three from './three.JPG';


export default class PortsProtocols extends React.Component {
	render() {
		return (
			<>

			<center>
				<img src={one}/>
				<p></p>
				<img src={two}/>
				<p></p>
				<img src={three}/>
				<p></p>
			</center>

			</>
		);
	}
}
